// TransactionSuccessPage.jsx
import React from 'react';

function TransactionSuccessPage({ transactionDetails }) {
    return (
        <div>
            <h2>Transaction Successful</h2>
            <p>Thank you for transferring!</p>
            <h3>Transaction Details:</h3>
            <ul>
                <li><strong>Transaction ID:</strong> {transactionDetails.transactionId}</li>
                <li><strong>Date:</strong> {transactionDetails.date}</li>
                <li><strong>Time:</strong> {transactionDetails.time}</li>
                <li><strong>Sender User ID:</strong> {transactionDetails.details.senderUserId}</li>
                <li><strong>Receiver Transaction ID:</strong> {transactionDetails.details.receiverTransactionId}</li>
                <li><strong>Amount:</strong> {transactionDetails.details.amount}</li>
                <li><strong>Reason:</strong> {transactionDetails.details.reason}</li>
            </ul>
        </div>
    );
}

export default TransactionSuccessPage;
